# Examples

```rust
#![feature(rev_into_inner)]

let s = "foobar";
let mut rev = s.chars().rev();
assert_eq!(rev.next(), Some('r'));
assert_eq!(rev.next(), Some('a'));
assert_eq!(rev.next(), Some('b'));
assert_eq!(rev.into_inner().collect::<String>(), "foo");
